import React from "react";
import Hero from "../hero/Hero";
import GenresList from "../genres/GenresList";
import genresList from "../../genresList.json";

const generos = {
  genres: [
    "Action",
    "Adventure",
    "Comedy",
    "Drama",
    "Fantasy",
    "Horror",
    "Mystery",
    "Romance",
    "Sci-Fi",
    "Thriller",
  ],
};

function Home({ movies }) {
  return (
    <>
      <GenresList generos={generos} />
      <Hero movies={movies} />
    </>
  );
}

export default Home;
